        if (props.currentPage === 'Contact' ){
             hide = true
        }
        console.log(visibilityFunction)
        return hide;
    }
    console.log(visibilityFunction(hide))



    return (
        <Fragment>
            <footer className={`${visibilityFunction === false ? styles.footer :'hide'} `}
                    style={{justifyContent: 'center'}}>


                <div className={`${visibilityFunction=== true ? 'fs-300' : 'hide'}`}>
                    Email: <a href="mailto:alora@beebettermassage.com">alora@beebettermassage.com</a>
