                </div>
                <div className={`${visibilityFunction=== true ? 'fs-300' : 'hide'}`}>
                    <a href="https://www.instagram.com/bee.better.massage">Instagram </a>
                </div>


            </footer>
        </Fragment>
    )
}

export default FooterContact;
